/////////////////////////////////////////////////////////////////////////////////////
//
//  Hypersubs provides a more convenient way to set your Supersubs in 
//  Fantasyleague.com's Classic Premier League fantasy football game.
//
//  Hypersubs automatically makes clear-cut choices for you, like fielding all 
//  of your full backs when you have no more than two active in a block of fixtures.
//  (You can still choose to avoid dangerous fixtures if you wish and have 
//  sufficient players available for the position.) Overall, you save a lot of 
//  clicks and can focus on the key decisions, which Hypersubs highlights.
//
//
//  WHAT YOU NEED   
//  
//  To use this version of Hypersubs, you need either:
//
//      Firefox v47.0 with the Greasemonkey extension v3.8+ 
//  or
//      Chrome v51.0 with the Tampermonkey extension v4.0+
//
//  or newer compatible versions. 
//
// 
//  LIMITATIONS AND DISCLAIMERS
//
//  This version of Hypersubs is intended to be compatible with the Fantasyleague.com 
//  Classic Premier League competition as of August 2016. Other competitions are not 
//  supported.
//
//  Hypersubs relies on the existing structure of the Fantasy League web site. 
//  It will stop working properly as soon as Fantasy League change how their 
//  Supersubs pages are structured.
//
//  Use at your own risk. This program was written as a personal exercise to learn 
//  the basics of a few technologies. It may well have bugs. Always be sure to 
//  check the Fantasy League site or their confirmation email to be certain that 
//  everything went right!
//
